package leet;

import java.util.*;

public class Solution423 {
    public static void main(String[] args) {
        String a = "";
        System.out.println(originalDigits(a));
    }

    public static String originalDigits(String s) {
        List<Integer> out = new ArrayList<>();
        StringBuilder str = new StringBuilder();
        Map<Character, Integer> map = new HashMap<>();

        for (char c : s.toCharArray()){
            if (map.containsKey(c)){
                map.put(c, map.get(c)+1);
            }
            else {
                map.put(c, 1);
            }
        }
        /*
         * 筛选0，2，4，6，8；这些数字具有特有字符
         */
        int count = 1;
        while (count != 0) {
            count = 0;
            if (map.containsKey('z')) {
                out.add(0);
                minusChar(map, "zero");
                count++;
            }
            if (map.containsKey('w')) {
                out.add(2);
                minusChar(map, "two");
                count++;
            }
            if (map.containsKey('u')) {
                out.add(4);
                minusChar(map, "four");
                count++;
            }
            if (map.containsKey('x')) {
                out.add(6);
                minusChar(map, "six");
                count++;
            }
            if (map.containsKey('g')) {
                out.add(8);
                minusChar(map, "eight");
                count++;
            }
        }
        /*
         * 筛选1，3，5，7；这些数字现在具有特有字符
         */
        count = 1;
        while (count != 0) {
            count = 0;
            if (map.containsKey('o')) {
                out.add(1);
                minusChar(map, "one");
                count++;
            }
            if (map.containsKey('t')) {
                out.add(3);
                minusChar(map, "three");count++;
            }
            if (map.containsKey('f')) {
                out.add(5);
                minusChar(map, "five");count++;
            }
            if (map.containsKey('s')) {
                out.add(7);
                minusChar(map, "seven");count++;
            }
        }
        /*仅仅只剩下9*/
        while (!map.keySet().isEmpty()) {
            out.add(9);
            minusChar(map, "nine");
        }

        Collections.sort(out);
        for (int val : out){
            str.append(val);
        }
        return str.toString();
    }

    private static void minusChar(Map<Character, Integer> map, String num){
        for (char c : num.toCharArray()) {
            map.put(c, map.get(c) - 1);
            if (map.get(c) == 0) map.remove(c);
        }
    }
}
